def numIslands(grid) -> int:
        if grid is None or len(grid) == 0:
            return 0

        rows = len(grid)
        cols = len(grid[0])

        visited = [[False for _ in range(cols)] for __ in range(rows)]

        count = 0
        for i in range(rows):
            for j in range(cols):
                count += dfs(grid, visited, rows, cols, i, j)

        return count

def pass_sanitize(row_max, col_max, row, col):
    if row >= row_max or row < 0 or col >= col_max or col < 0:
        return False

    return True

def dfs(grid, visited, row_max, col_max, row, col):
    if not pass_sanitize(row_max, col_max, row, col):
        return 0

    if visited[row][col]:
        return 0

    visited[row][col] = True
    count = 0
    if grid[row][col] == "1":
        print(f"checking neighbors for({row},{col})")
        row_neigh = [0, 0, -1, 1]
        col_neigh = [1, -1, 0, 0, ]
        count += 1
        for neigh in zip(row_neigh, col_neigh):
            r = row + neigh[0]
            c = col + neigh[1]
            dfs(grid, visited, row_max, col_max, r, c)

    return count

